// ContactUsPage.js

import React from 'react';
import image2 from './Abhay_A_Rao.jpg'
import defaultpic from './default.jpeg'
import linkedInIcon from './linkedIn.png'
import githubIcon from './github.png'
import '../App.css'; 

const contributors = [
  {
    id: 1,
    name: 'Abhirudh B.N.',
    email: 'abhirudh@example.com',
    linkedin: 'https://www.linkedin.com/in/abhirudh',
    github: 'https://github.com/abhirudh',
    photo: defaultpic,
  },
  {
    id: 2,
    name: 'Abhay A Rao',
    email: 'abhay@example.com',
    linkedin: 'https://www.linkedin.com/in/abhayrao',
    github: 'https://github.com/abhayrao',
    photo: image2,
  },
  {
    id: 3,
    name: 'Aadhya Darshan',
    email: 'aadhya@example.com',
    linkedin: 'https://www.linkedin.com/in/aadhyadarshan',
    github: 'https://github.com/aadhyadarshan',
    photo: defaultpic,
  },
];

const ContactUsPage = () => {
  return (
    <div>
      <div id="about">
        <h3>Our Team</h3>
        <div className="team-members">
          {/* Display contributor objects */}
          {contributors.map((contributor) => (
            <div key={contributor.id} className="team-member">
              <img src={contributor.photo} alt={contributor.name} />
              <h4>{contributor.name}</h4>
              <ul>
                <li><a href={`mailto:${contributor.email}`}>{contributor.email}</a></li>
                <li><a href={contributor.linkedin} target="_blank" rel="noopener noreferrer">
                  <img src={linkedInIcon} alt="LinkedIn" className="icon" style={{ width: '50px', height: '30px' }}/>
                </a></li>
                {' | '}
                <li><a href={contributor.github} target="_blank" rel="noopener noreferrer">
                  <img src={githubIcon} alt="GitHub" className="icon" style={{ width: '20px', height: '20px' }}/>
                </a></li>
              </ul>
            </div>
          ))}
        </div>

        <h3>Contact Us</h3>
        <p>Collaboration starts with a conversation. Whether you have a project in mind, want to discuss opportunities, or just want to say hello, we are just a click away.</p>
      </div>
    </div>
  );
};

export default ContactUsPage;
